const fakedata = () => {
  const [UserData,setdata] = useState([]);
  useEffect(()=>{
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(users => this.setdata({ monsters: users }));

  })
  return (
    <div>

    </div>
  )
}

export default UserData;
